const callInWindow = require('callInWindow');
const copyFromWindow = require('copyFromWindow');
const dl_push = require('createQueue')('dataLayer');
const templateStorage = require('templateStorage');
const getCookie = require('getCookieValues');
const log = require('logToConsole');

const LOGTAG = "OT OnConsentChangedListener >";
templateStorage.setItem('initialStateOfCookieBanner', getCookie("OptanonAlertBoxClosed") && typeof getCookie("OptanonAlertBoxClosed")[0]!=='undefined' );

function OnConsentChangedListener(){
	log(LOGTAG,"OnConsentChangedListener");
	const domainData = callInWindow('OneTrust.GetDomainData');
	if( ( domainData.ConsentModel.Name==='opt-out' && templateStorage.getItem('initialStateOfCookieBanner')===true ) || domainData.ConsentModel.Name!=='opt-out' ){
		log(LOGTAG,"push event allowed");
		dl_push({event:data.event_name});
	}
	else{
		log(LOGTAG,"push event stopped");
	}
	templateStorage.setItem('initialStateOfCookieBanner', getCookie("OptanonAlertBoxClosed") && typeof getCookie("OptanonAlertBoxClosed")[0]!=='undefined' );
}
let  oneTrustObject = copyFromWindow('OneTrust');
if(typeof oneTrustObject!== 'undefined'){
  //Add callback to window so that GCM is updated when consent changes if consent mode is active
  log(LOGTAG,"Callinwindow : "+ callInWindow("OneTrust.OnConsentChanged", OnConsentChangedListener));
}
else{
	log(LOGTAG,"OneTrust Global Variable undefined. Ensure you trigger this tag WHEN OneTrust is loaded.");
}

// Call data.gtmOnSuccess when the tag is finished.
data.gtmOnSuccess();


